{"post_stream":{"posts":[{"id":3000752,"name":"brandon herr","username":"brandonzx3","avatar_template":"/user_avatar/www.chiefdelphi.com/brandonzx3/{size}/269905_2.png","created_at":"2022-01-31T15:40:09.558Z","cooked":"<p>The PhotonVision NetworkTable doesn’t allow LabView users to access the data of multiple targets. has anyone created a workaround for this problem or have any ideas/suggestions to doing this</p>","post_number":1,"post_type":1,"posts_count":14,"updated_at":"2022-01-31T17:01:18.252Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":78,"reads":136,"readers_count":135,"score":417.2,"yours":false,"topic_id":401826,"topic_slug":"using-photonvision-in-labview-to-find-multiple-targets","display_username":"brandon herr","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":2,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":42929,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"5847 Programming Mentor"},"post_url":"/t/using-photonvision-in-labview-to-find-multiple-targets/401826/1","custom_user_title":"5847 Programming Mentor","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null,"can_vote":false},{"id":3000857,"name":"Jason Daming","username":"jdaming","avatar_template":"/user_avatar/www.chiefdelphi.com/jdaming/{size}/137720_2.png","created_at":"2022-01-31T19:46:37.259Z","cooked":"<p>This decoding of the rawBytes key is normally done with a library like <a href="https://github.com/PhotonVision/photonlib/blob/a3eefd7712eb77e3610dde60993f626229b8f517/src/main/java/org/photonvision/PhotonPipelineResult.java#L136-L148">PhotonLib</a>.  LabVIEW doesn’t have a PhotonLib library.  If there is demand for one it could probably be made, but unlikely to be soon.</p>
<p>If you want to do this yourself you can see the Java code above is decoding the rawBytes packet.  LabVIEW has several VI’s built in for byte conversion like String to Byte Array.  I don’t have a computer with a LabVIEW install, PhotonVision, and a robot handy so I can’t really put together a demo.  Do you think you can record some of the data you are seeing and see if we can make sense of it?</p>","post_number":2,"post_type":1,"posts_count":14,"updated_at":"2022-01-31T19:46:37.259Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":2,"reads":118,"readers_count":117,"score":48.6,"yours":false,"topic_id":401826,"topic_slug":"using-photonvision-in-labview-to-find-multiple-targets","display_username":"Jason Daming","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"link_counts":[{"url":"https://github.com/PhotonVision/photonlib/blob/a3eefd7712eb77e3610dde60993f626229b8f517/src/main/java/org/photonvision/PhotonPipelineResult.java#L136-L148","internal":false,"reflection":false,"clicks":7}],"read":true,"user_title":"","bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":18342,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"WPILib Developer (Documentation), CSA"},"post_url":"/t/using-photonvision-in-labview-to-find-multiple-targets/401826/2","custom_user_title":"WPILib Developer (Documentation), CSA","reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3001847,"name":"Matt","username":"thatmattguy","avatar_template":"/user_avatar/www.chiefdelphi.com/thatmattguy/{size}/222358_2.png","created_at":"2022-02-02T14:38:04.692Z","cooked":"<p>Here’s a C++ example of the byte-packed struct. Strings are just character (byte) arrays, so that seems promising.</p>
<pre><code class="lang-auto">struct Packet {
  double latency;
  char targetCount;
  Target target[targetCount];
};

struct Target {
  double yaw;
  double pitch;
  double area;
  double skew;
  double x;
  double y;
  double r;
  double cx1; double cy1; // Corners, repeats 4x
  double cx2; double cy2;
  double cx3; double cy3;
  double cx4; double cy4;
};
</code></pre>
<p>I don’t know labview, but it should be possible to implement this yourself.</p>","post_number":3,"post_type":1,"posts_count":14,"updated_at":"2022-02-02T14:38:22.503Z","reply_count":1,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":0,"reads":92,"readers_count":91,"score":23.4,"yours":false,"topic_id":401826,"topic_slug":"using-photonvision-in-labview-to-find-multiple-targets","display_username":"Matt","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":37738,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/using-photonvision-in-labview-to-find-multiple-targets/401826/3","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3001890,"name":"Jim simpson","username":"JSIMPSO","avatar_template":"/letter_avatar_proxy/v4/letter/j/e9a140/{size}.png","created_at":"2022-02-02T16:02:43.587Z","cooked":"<p>On first glance, It does appear that this could be decoded in LabVIEW.</p>
<p>The photonlib reference above appears to point to a read-only archived repository?</p>
<p>Some other things I gleaned quickly from the code</p>
<p>It appears the space occupied by the data types is as follows.  (It used to that not all C types used the same spaced depending on the OS and compiler.)<br>
- byte - 1 byte  (I8)<br>
- int - 4 bytes (I32)<br>
- double - 8 bytes (dbl)</p>
<p>PhotonCamera seems to contain the names of the network table variables.  It appears that they are:<br>
rawBytes<br>
driverMode<br>
inputSaveImgCmd<br>
outputSaveImgCmd<br>
pipelineIndex<br>
ledMode<br>
version<br>
prefixed by<br>
/photonvision//<br>
where<br>
 is the string name of the particular camera</p>
<p>if photolib was ported to LabVIEW do you think the creators would host it with the other code in the repository?</p>","post_number":4,"post_type":1,"posts_count":14,"updated_at":"2022-02-02T16:02:43.587Z","reply_count":0,"reply_to_post_number":3,"quote_count":0,"incoming_link_count":2,"reads":77,"readers_count":76,"score":40.4,"yours":false,"topic_id":401826,"topic_slug":"using-photonvision-in-labview-to-find-multiple-targets","display_username":"Jim simpson","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":37738,"username":"thatmattguy","name":"Matt","avatar_template":"/user_avatar/www.chiefdelphi.com/thatmattguy/{size}/222358_2.png"},"bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":26698,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/using-photonvision-in-labview-to-find-multiple-targets/401826/4","custom_user_title":null,"reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3001982,"name":"Jim simpson","username":"JSIMPSO","avatar_template":"/letter_avatar_proxy/v4/letter/j/e9a140/{size}.png","created_at":"2022-02-02T18:31:48.940Z","cooked":"<p>Attached is a zip file with a LabVIEW library that might decode the packet.</p>
<p><a class="attachment" href="/uploads/short-url/gjp3YLIZRGOpDrnRdbRiryeQuWF.zip">PhotonVisionLibLabVIEW.zip</a> (64.8 KB)</p>
<p>Add the library file to your robot project and call “PhotonCamera_GetLatestResult”.  Pass it the camera name.  It returns a cluster with the data.</p>
<p><img src="https://www.chiefdelphi.com/uploads/default/original/3X/1/c/1c9be700da0a8820f8c088278dcf0cac0e272909.png" alt="image" data-base62-sha1="455o585cJnbPagIQk56tra0sm2l" width="336" height="209"></p>
<p><img src="https://www.chiefdelphi.com/uploads/default/original/3X/4/1/41bd04463ad28dfbe867ca063a95ce2cf71d6c30.png" alt="image" data-base62-sha1="9ny07CQsVut6U3UNWRpjpXXf9Pq" width="359" height="167"></p>
<p>Here is the cluster<br>
<img src="https://www.chiefdelphi.com/uploads/default/original/3X/c/d/cdefcbf66b2bc6eb20ce8f403a3e47c9be594e91.png" alt="image" data-base62-sha1="tnNDTRkQQO2VMuXTPk87cm5qpAR" width="482" height="424"></p>
<p>Use the cluster unpack and array index functions to get individual pieces of data.</p>
<p>If there is interest I can continue to create the rest of the library.</p>
<p>Note that this version returns the POSE as individual X,Y,Rotation values.  I could return a Pose, in the future but this library would need the LabVIEW trajectory and control library as a dependency.</p>
<p>Happy roboting.</p>","post_number":5,"post_type":1,"posts_count":14,"updated_at":"2022-02-02T18:31:48.940Z","reply_count":2,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":2,"reads":71,"readers_count":70,"score":94.2,"yours":false,"topic_id":401826,"topic_slug":"using-photonvision-in-labview-to-find-multiple-targets","display_username":"Jim simpson","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"link_counts":[{"url":"/uploads/short-url/gjp3YLIZRGOpDrnRdbRiryeQuWF.zip","internal":true,"reflection":false,"clicks":0}],"read":true,"user_title":"","bookmarked":false,"actions_summary":[{"id":2,"count":4}],"moderator":false,"admin":false,"staff":false,"user_id":26698,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/using-photonvision-in-labview-to-find-multiple-targets/401826/5","custom_user_title":null,"reactions":[{"id":"heart","type":"emoji","count":4},{"id":"+1","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":5,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3002097,"name":"AfterTen","username":"AfterTen","avatar_template":"/user_avatar/www.chiefdelphi.com/afterten/{size}/11780_2.png","created_at":"2022-02-02T21:20:09.390Z","cooked":"<p>There is interest, at least from me. We will be using PhotonVision with the SnakeEyes Pi Hat this year and getting all the info in LabView would be extremely helpful.</p>
<p>I’m not interested in POSE so if that’s all that would be added I think what you already posted would be sufficient for me.</p>
<p>Thanks for what you have done so far though.</p>","post_number":6,"post_type":1,"posts_count":14,"updated_at":"2022-02-02T21:20:09.390Z","reply_count":1,"reply_to_post_number":5,"quote_count":0,"incoming_link_count":0,"reads":55,"readers_count":54,"score":16.0,"yours":false,"topic_id":401826,"topic_slug":"using-photonvision-in-labview-to-find-multiple-targets","display_username":"AfterTen","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":26698,"username":"JSIMPSO","name":"Jim simpson","avatar_template":"/letter_avatar_proxy/v4/letter/j/e9a140/{size}.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":27113,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"3572 Wavelength - Programming Mentor"},"post_url":"/t/using-photonvision-in-labview-to-find-multiple-targets/401826/6","custom_user_title":"3572 Wavelength - Programming Mentor","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3002108,"name":"Jim simpson","username":"JSIMPSO","avatar_template":"/letter_avatar_proxy/v4/letter/j/e9a140/{size}.png","created_at":"2022-02-02T21:39:40.494Z","cooked":"<p>Okay.  Keep in mind I’ve done very little testing.  If have issues send a picture of the byte stream data and the resulting cluster and I’ll see what I can do.</p>
<p>I started down the path of doing the entire photo lib.   So far the photo camera is coded and most of the photon utils.  This did need the geometry functions so for those having the trajectory / control lib will be a prerequisite to those functions compiling.</p>","post_number":7,"post_type":1,"posts_count":14,"updated_at":"2022-02-02T21:39:40.494Z","reply_count":0,"reply_to_post_number":6,"quote_count":0,"incoming_link_count":1,"reads":53,"readers_count":52,"score":15.6,"yours":false,"topic_id":401826,"topic_slug":"using-photonvision-in-labview-to-find-multiple-targets","display_username":"Jim simpson","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":27113,"username":"AfterTen","name":"AfterTen","avatar_template":"/user_avatar/www.chiefdelphi.com/afterten/{size}/11780_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":26698,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/using-photonvision-in-labview-to-find-multiple-targets/401826/7","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3002110,"name":"AfterTen","username":"AfterTen","avatar_template":"/user_avatar/www.chiefdelphi.com/afterten/{size}/11780_2.png","created_at":"2022-02-02T21:47:08.921Z","cooked":"<p>Thanks, I just started looking at the photonlib libarary and methods like “calculateDistanceToTargetMeters” would be very useful so your work is much appreciated.</p>","post_number":8,"post_type":1,"posts_coun